VALUES ('8014806040025', '2 pizzaboden Vollkorn', 'ZUBEREITUNG Ofen auf 220° vorheizen. Mischen Sie geschälte Tomaten, Salz, Pfeffer und 2 Teelöffel Öl. Bestreichen Sie den Pizzaboden mit der Soße und belegen Sie ihn dann mit Zutaten Ihres Geschmacks. Zum Schluß mit ca 50 g geriebenenm Käse und ein wenig Oregano bestreuen und 10 Minuten backen. Guten Appetit! ZUTATEN: Vollkornweizenmehl® (35,20 %), Weizenauszugsmehl Wasser, Hefe, Meersalz, Extra natives Olivenöl* Haus biologischer Landbau Verpackt unter Schutzatmosphäre. Kühl und trocken lagern. Ungeöffnet mindestens haltbar bis und Chargennummer: siehe Packung 8 014806 040025', 'https://static.openfoodfacts.org/images/products/801/480/604/0025/front_fr.4.400.jpg', '', '', '', '', '', '', '', '', '', '1');

